import Layout from "../../components/ui/Layout";

import { Button, ButtonGroup } from 'react-bootstrap';

const Home = ({ children }) => {

    const handleClick = () => {
        history.push('/login')
    }

    return (
        <Layout>
            <div>
            <h1>RESTAURANT TINDER APP</h1>
            <p>Press the button to login</p>
            <ButtonGroup>
                <Button onClick={handleClick}>Login</Button>
            </ButtonGroup>
            {children}
            </div>
        </Layout>
    );
}
export default Home;
